import React from 'react';
import { useTheme } from '../hooks/useTheme';

const TestResultPanel = ({ testCases = [], results = [], isDarkMode }) => {
  const { colors } = useTheme(isDarkMode);

  const renderResult = (result, index) => {
    if (!result) return null;

    if (result.error) {
      return (
        <div 
          className="p-4 rounded-md mb-4"
          style={{ backgroundColor: colors.background.secondary }}
        >
          <div className="flex items-center mb-2">
            <div 
              className="w-2 h-2 rounded-full mr-2"
              style={{ backgroundColor: colors.status.error }}
            />
            <span 
              className="font-medium"
              style={{ color: colors.text.primary }}
            >
              Test Case {index + 1} Failed
            </span>
          </div>
          <div 
            className="text-sm font-mono mt-2 p-3 rounded"
            style={{ 
              backgroundColor: colors.background.primary,
              color: colors.status.error,
              border: `1px solid ${colors.border.secondary}`
            }}
          >
            <div className="mb-2">Error:</div>
            <pre className="whitespace-pre-wrap">{result.error}</pre>
          </div>
        </div>
      );
    }

    return (
      <div 
        className="p-4 rounded-md mb-4"
        style={{ backgroundColor: colors.background.secondary }}
      >
        <div className="flex items-center mb-2">
          <div 
            className="w-2 h-2 rounded-full mr-2"
            style={{ backgroundColor: result.passed ? colors.status.success : colors.status.error }}
          />
          <span 
            className="font-medium"
            style={{ color: colors.text.primary }}
          >
            Test Case {index + 1} {result.passed ? 'Passed' : 'Failed'}
          </span>
        </div>
        
        <div className="space-y-2">
          <div>
            <span 
              className="text-sm"
              style={{ color: colors.text.secondary }}
            >
              Input:
            </span>
            <div 
              className="text-sm font-mono mt-1 p-2 rounded"
              style={{ 
                backgroundColor: colors.background.primary,
                color: colors.text.primary,
                border: `1px solid ${colors.border.secondary}`
              }}
            >
              {JSON.stringify(testCases[index]?.input)}
            </div>
          </div>

          <div>
            <span 
              className="text-sm"
              style={{ color: colors.text.secondary }}
            >
              Expected Output:
            </span>
            <div 
              className="text-sm font-mono mt-1 p-2 rounded"
              style={{ 
                backgroundColor: colors.background.primary,
                color: colors.text.primary,
                border: `1px solid ${colors.border.secondary}`
              }}
            >
              {JSON.stringify(testCases[index]?.expectedOutput)}
            </div>
          </div>

          <div>
            <span 
              className="text-sm"
              style={{ color: colors.text.secondary }}
            >
              Your Output:
            </span>
            <div 
              className="text-sm font-mono mt-1 p-2 rounded"
              style={{ 
                backgroundColor: colors.background.primary,
                color: colors.text.primary,
                border: `1px solid ${colors.border.secondary}`
              }}
            >
              {JSON.stringify(result.output)}
            </div>
          </div>
        </div>
      </div>
    );
  };

  if (!results.length) {
    return (
      <div className="p-4">
        <h3 
          className="text-lg font-medium mb-4"
          style={{ color: colors.text.primary }}
        >
          Test Results
        </h3>
        <div 
          className="p-4 rounded-md"
          style={{ 
            backgroundColor: colors.background.secondary,
            color: colors.text.secondary 
          }}
        >
          Run your code to see the results
        </div>
      </div>
    );
  }

  return (
    <div className="p-4">
      <h3 
        className="text-lg font-medium mb-4"
        style={{ color: colors.text.primary }}
      >
        Test Results
      </h3>
      <div className="space-y-4">
        {results.map((result, index) => (
          <div key={index}>
            {renderResult(result, index)}
          </div>
        ))}
      </div>
    </div>
  );
};

export default TestResultPanel;
